/* Styles */
import './eventItem.scss';

export function EventItem() {
    return (
        <div className='eventItem'>
            <img src={img01} alt="" />
            <div className='eventContent'>
                <h3>Dia de la Madre</h3>
                <p>Maestra Rebacina haciendo un recital para el dia de las madres</p>
            </div>
        </div>
    );
}
